import './App.js'
import createSudoku from './App.js'
import React from 'react'
import ReactDOM from 'react-dom'
let sudoku=createSudoku()
const root=ReactDOM.createRoot(document.getElementById('root'));
class Sudoku extends React.Component{
     constructor(props)
     {
      super(props)

     }
     render(){
      return(
        this.props.arr.map((temp)=>
        {
          <div>
            <Row arra={temp}/>
            <br></br>
          </div>
        })
      )
     }
}
class Row extends React.Component{
  constructor(props){
    super(props)
  }
  render(){
    return (
      this.props.arra.map((temp)=><h>{temp}</h>)
    )
  }
}
root.render(<Sudoku arr={sudoku}/>)
